import React, { Component } from 'react'
import {Line} from 'react-chartjs-2'
const buga = [65, 10, 13, 25, 35, 59, 80, 81, 56, 55, 40]
const secondBuga =[20, 30, 40, 50, 60, 70, 80,30,20,10, 12]
const thirdBuga =[1, 5, 10, 15, 20, 25, 30, 40, 50, 60,70]
const fourthBuga =[8, 16, 24, 32, 40, 48, 56,64,72,80,88]
const fiveBuga =[4, 8, 12, 16, 20, 24, 28, 32, 36, 40,44]
const data = {
    labels: ["januar", "desember", "november", "oktober", "september", "august", "juli", "juni", "mai", "april", "mars", "februar"],
    datasets: [
      {
        label: 'Open',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(255,0,0,1)',
        borderColor: 'rgba(255,0,0,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(255,0,0,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(255,0,0,1)',
        pointHoverBorderColor: 'rgba(255,0,0,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: buga
      },
      {
        label: 'High',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(0,0,255,1)',
        borderColor: 'rgba(0,0,255,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(0,0,255,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(0,0,255,1)',
        pointHoverBorderColor: 'rgba(0,0,255,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: secondBuga
      },
      {
        label: 'low',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(0,255,0,1)',
        borderColor: 'rgba(0,255,0,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(0,255,0,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(0,255,0,1)',
        pointHoverBorderColor: 'rgba(0,255,0,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: thirdBuga
      },
      {
        label: 'Close',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(0,0,0,1)',
        borderColor: 'rgba(0,0,0,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(0,0,0,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(0,0,0,1)',
        pointHoverBorderColor: 'rgba(0,0,0,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: fourthBuga
      },
      {
        label: 'Volume',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(255,255,0,1)',
        borderColor: 'rgba(255,255,0,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(255,255,0,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(255,255,0,1)',
        pointHoverBorderColor: 'rgba(255,255,0,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: fiveBuga
      }
    ],
    options: {
        scales: {
            xAxes: [{
                ticks: {
                    callback: function(tick, index) {
                        return (index % 2) ? "" : tick;
                    }
                }
            }],
            yAxes: [{
                ticks: {
                    beginAtZero: true
                }
            }]
        }
    }
  };

export default class FetchRandom extends Component {
    state = {
        loading : false,
        person: null,
        case : '',
    }
    async componentDidMount(){
        //const url = "https://www.fxempire.com/api/v1/en/stocks/chart/candles?Identifier=AAPL.XNAS&IdentifierType=Symbol&AdjustmentMethod=All&IncludeExtended=False&period=5&Precision=Minutes&StartTime=8/28/2020%2016:0&EndTime=9/4/2020%2023:59&_fields=ChartBars.StartDate,ChartBars.High,ChartBars.Low,ChartBars.StartTime,ChartBars.Open,ChartBars.Close,ChartBars.Volume";
        // const response = await fetch(url)
        // const data = await response.json()
        // console.log(data)
        // console.log(this.props.timeStamps)
        
    }
    render(){
        return (
            <div>
                {this.state.loading ? 
                <div>{this.props.timeStamps}</div> :
                <div>
                 <Line    
                    data={data}               
                    width={600}
                    height={400}
                    options={{ maintainAspectRatio: false }}
                />
                </div>}
            </div>
        )
    }
}
